var UiObjectBase = require("./ui_object_base.js");
var UiObjectBaseTO = UiObjectBase.UiObjectBaseTO;
var UiObjectBaseDescription = UiObjectBase.UiObjectBaseDescription;
var HelperBehaviors = require("./helper_behaviors.js");

/**
 * The description of a UIAPro group test object.
 * @param {Object} [props] Initializes a UIAPro Group test object using the supplied property bag.
 * @returns {Group} the description object that was initialized.
 * @class Group
 * @extends UIAPro.UiObjectBaseDescription
 * @memberof UIAPro
 */
function Group(props) {
    var groupDesc = new UiObjectBaseDescription("Group");

    groupDesc._defineByPropertyBag(props);
    return groupDesc;
}

/**
 * A UIAPro group.
 * @constructor
 * @class GroupTO
 * @extends UIAPro.UiObjectBaseTO
 * @memberof UIAPro
 */
function GroupTO(session, description) {
    description = description || Group();
    var groupTO = new UiObjectBaseTO("UIAProGroup", session, description);
    
    return groupTO;
}

module.exports.GroupTO = GroupTO;
module.exports.Group = Group;